window.bookSummaryJSON = "<p>Ken and party are training with his grandparents, preparing themselves to the next semester of Haylon. Yet, even after the Gransmens' deaths, there are still plots from the Kaiming targeting Ken. After thwarting an attack on him at the Nagato Clan, Ken heads back to Haylon to get the strength he needs.</p> <p>After all, at the end of this semester, Crimson owes him almost a week of personal training, and she sets ambitious goals for him. If he can complete them, he'll be going to the Elven world for summer break.</p> <p>In the meantime, Ken just needs to get rid of all these magazines that are cluttering up his inventory!</p>"; 
